function Foodcard(props){
    let count = 0;
    function ordercount(){
        count++
    }

    return(
        <div className = "foodcard">
            <img className= 'foodimage' src={props.img}></img>
            <span className="price">{props.Price}/- Only</span>
            <h3 className = 'foodname'>{props.foodname}</h3>
            <p className = 'fooddesc'>{props.fooddesc}</p>
            <span className = 'offer'>{props.offer}</span>
            <br></br>
            <button className = 'orderbtn' onClick={ordercount}>Order Now</button>
            <span>{count}</span>
        </div>
    );
}


export default Foodcard;
